import { Link } from "react-router-dom";

function Studios(props) {
  const { studios } = props;
  return (
    <div>
      <h3>This is studios page</h3>
      {studios.map((studio) => (
        <div key={studio.id}>
          <Link to="/studios/:id">
            <img src={studio.img_url} alt={studio.business_name} />
            <h3>{studio.business_name}</h3>
          </Link>
        </div>
      ))}
    </div>
  );
}

export default Studios;
